// Dashboard.js
import React from 'react';
import TemperatureData from './TemperatureData';
import PressureData from './PressureData';
import ColorData from './ColorData';
import FreezingPointData from './FreezingPointData';
import MeltingPointData from './MeltingPointData';
import LocationData from './LocationData';
import QuantityData from './QuantityData';
import RainRateData from './RainRateData';
import SizeData from './SizeData';
import WeightGramsData from './WeightGramsData';

function Dashboard() {
  return (
    <div>
      <h1>MongoDB Dashboard</h1>
      <TemperatureData />
      <PressureData />
      <ColorData />
      <FreezingPointData />
      <MeltingPointData />
      <LocationData />
      <QuantityData />
      <RainRateData />
      <SizeData />
      <WeightGramsData />
      {/* Add components for other collections here */}
    </div>
  );
}

export default Dashboard;
